import React, { useState } from 'react';
import "../Home/home.css";
impo

const NavBar = () => {
  const [isNavOpen, setIsNavOpen] = useState(false);

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <div className="aaaa">
      <nav>
        <div className="lists">
          <input type="checkbox" id="check" checked={isNavOpen} onChange={toggleNav} />
          <label htmlFor="check" className="checkbtn">
            <i className="fas fa-bars"></i>
          </label>
          <label className="logo">
            <img src="../homepage/Group.png" alt="Logo" />
          </label>
          <ul className="nav-menu" style={{ display: isNavOpen ? 'block' : 'none' }}>
            <li><a href="about.html">About Us</a></li>
            <li><a href="services.html">Services</a></li>
            <li><a href="destination.html">Destination Weddings</a></li>
            <li><a href="gallery.html">Gallery</a></li>
            <li><a href="blog.html">Blog</a></li>
            <li><a href="contact.html">Contact</a></li>
            <li className="rightnav"><a href="login.html">Login</a></li>
          </ul>
        </div>
      </nav>
      {/* Rest of your HTML content */}
    </div>
  );
};

export default NavBar;
